import React from "react";
import { useState } from "react";
import axios from "axios";
import { useEffect } from "react";

const FetchName = () =>
    {
        const [name,setName]=useState([])
        const FetchSearch = () =>
        {
        axios
        .get(` https://finnhub.io/api/v1/search?q=apple&token=cjmeg19r01qmdd9puljgcjmeg19r01qmdd9pulk0`)

        .then((response) =>
        {
            const {symbol} =response.data.result[0]
              console.log(symbol)  
              useState(symbol)
        })
    } 
    useEffect(()=>{
        FetchName()
    },[name])
}   
export default FetchName
